import './App.css';
import Header from "./components/Header";
import Section from './components/Section/Section';
import About from './components/Sections/About/About';
function App() {
  return (
    <div className="App">
     <Header />
     <Section title="About"><About /></Section>
     <Section title="Work" />
     <Section title="Contact" />
    </div>
  );
}

export default App;
